script: |
  super -f text -I q10797.spq | sort > q10797.out

inputs:
  - name: q10797.spq
    data: |
      SELECT DISTINCT col1 * col0 - col2 AS col1 FROM tab2 (FORMAT parquet) WHERE ( col0 / - - ( - ( + - 12 ) ) * - 16 - - ( - col2 ) ) BETWEEN col0 + + col1 AND - CAST ( col1 AS REAL ) * - 61;
  - name: tab2

outputs:
  - name: q10797.out
    data: |
